A '''gourmet impling jar''' is the result of successfully catching a [[Gourmet impling]], while also having an empty [[impling jar]].

This jar can be traded in singularly to [[Elnock Inquisitor]] for 3 empty impling jars.

One gourmet impling jar, along with three [[baby impling jar]]s and two [[young impling jar]]s, can be traded to Elnock for a vial of [[Imp repellent]]. Alternatively, three gourmet impling jars, along with two [[earth impling jar]]s and one [[essence impling jar]], can be traded for a [[magic butterfly net]].

==Loot==
At current [[Grand Exchange]] prices, opening a gourmet impling jar gives {{Coins|{{ImpValue|gourmet|jar=yes}} round 0}} worth of loot, on average. This means opening gourmet impling jars marks an average profit of {{Coins|{{ImpValue|gourmet|jar=yes}}-{{GEP|Gourmet impling jar}} round 0}} per jar, however this does not include loot from clue scrolls.

On average, one would profit {{Coins|25*({{ImpValue|gourmet|jar=yes}}-{{GEP|Gourmet impling jar}}) round 0}} to get an [[clue scroll (easy)|easy clue scroll]] from gourmet impling jars at current [[Grand Exchange]] prices, excluding the rewards from the completed [[Treasure Trail]]s.

